def transform(sequence):
    result = [sequence[0]]
    for i in range(1, len(sequence)-1):
        if sequence[i] != sequence[i-1] and sequence[i] != sequence[i+1]:
            result.append(sequence[i])
        else:
            result.append(sequence[i-1])
    result.append(sequence[-1])
    return ''.join(result)
